INSERT INTO `packages` VALUES (3, 'Matrimonio: Animazione bambini', 'Durante il matrimonio i bambini sono, solitamente, coloro che si annoiano di più, ma possiamo proporvi una soluzione! Animatori professionisti che coinvolgeranno i bambini in divertenti attività.\n\nPranzo/Cena con gli animatori\nLaboratori a tema\nGiochi & Caccia al tesoro\nBaby Dance con Mascotte\nTruccabimbi & Palloncini\nZucchero filato…', 1, 17, 500.00, NULL);
